-- ----------------------------
-- View structure for `v_cta_cte`
-- ----------------------------
DROP VIEW IF EXISTS `v_cta_cte`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_cta_cte` AS select `e`.`NRO_GUIA` AS `NRO_GUIA`,`e`.`PRECIO` AS `PRECIO`,`e`.`COMISION_COMISIONISTA` AS `COMISION_COMISIONISTA`,`e`.`COMISION_SUCURSAL` AS `COMISION_SUCURSAL`,`cl`.`nombre` AS `nombre`,`cl`.`codigo` AS `codigo`,`cl`.`razon_social` AS `razon_social`,`ps`.`NOMBRE_Y_APELLIDO` AS `NOMBRE_Y_APELLIDO`,`ps`.`FECHA` AS `fecha_pasaje`,`p`.`importe` AS `importe_pago`,`e`.`PRECIO` AS `importe_encomienda`,`ps`.`PRECIO` AS `importe_pasaje`,`cc`.`fecha` AS `fecha_ctacte` from ((((`ctactes` `cc` join `clientes` `cl` on((`cc`.`id_cliente` = `cl`.`codigo`))) left join `encomiendas` `e` on((`cc`.`id_encomienda` = `e`.`NRO_GUIA`))) left join `pagos` `p` on((`cc`.`id_pago` = `p`.`codigo`))) left join `pasajes` `ps` on((`cc`.`id_pasaje` = `ps`.`CODIGO`)));

-- ----------------------------
-- View structure for `v_detalle_factura`
-- ----------------------------
DROP VIEW IF EXISTS `v_detalle_factura`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sergio`@`10.20.12.37` SQL SECURITY DEFINER VIEW `v_detalle_factura` AS select concat_ws(`p`.`CODIGO`,`ve`.`codigo`,`e`.`NRO_GUIA`) AS `codificacion`,concat_ws(`e`.`FECHA`,`p`.`FECHA`,`ve`.`fecha_salida`) AS `fecha_generada`,`f`.`FECHA` AS `fecha_factura` from (((`facturas` `f` join `encomiendas` `e` on((_utf8'' = _utf8''))) join `pasajes` `p`) join `viajes_especiales` `ve`) where ((`f`.`CODIGO` = _utf8'p.id_factura') or (`f`.`CODIGO` = _utf8've.id_factura') or (_utf8'f.codigo' = _utf8'e.id_factura'));

-- ----------------------------
-- View structure for `v_precio_encomienda`
-- ----------------------------
DROP VIEW IF EXISTS `v_precio_encomienda`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_precio_encomienda` AS select `te`.`tipo_encomienda` AS `tipo_encomienda`,`te`.`descripcion` AS `descripcion`,`te`.`precio` AS `precio` from ((((`rel_usuario_comision_descuento` `rucd` join `tipos_de_usuarios` `tu`) join `tipos_de_encomiendas` `te`) join `comisiones_y_descuentos` `cd`) join `usuarios` `u`) where ((`u`.`id_tipo_usuario` = `tu`.`codigo`) and (`tu`.`codigo` = `rucd`.`Id_tipo_usuario`) and (`rucd`.`id_comisiones_y_descuentos` = `cd`.`codigo`) and (`te`.`activa` = 'S') and (`tu`.`activo` = 'S') and (`u`.`activo` = '"S"') and (`rucd`.`id_tipo_encomienda` = `te`.`codigo`));
